import React from 'react';
import clsx from 'clsx';
import { makeStyles, useTheme } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import CssBaseline from '@material-ui/core/CssBaseline';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import ChevronLeftIcon from '@material-ui/icons/ChevronLeft';
import ChevronRightIcon from '@material-ui/icons/ChevronRight';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react'
import { connect } from 'react-redux'
import { saveMapCoords } from '../redux/actions/index'

const drawerWidth = 400;

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
  },
  appBar: {
    transition: theme.transitions.create(['margin', 'width'], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginRight: drawerWidth,
    transition: theme.transitions.create(['margin', 'width'], {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  hide: {
    display: 'none',
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  drawerHeader: {
    display: 'flex',
    alignItems: 'center',
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar,
    justifyContent: 'flex-end',
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
    transition: theme.transitions.create('margin', {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    marginRight: -drawerWidth,
  },
  contentShift: {
    transition: theme.transitions.create('margin', {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
    marginRight: 0,
  },
}));

export class AaSD extends Component {
  classes = useStyles();
  theme = useTheme();

  handleDrawerOpen = () => {
    setOpen(true);
  };

  handleDrawerClose = () => {
    setOpen(false);
  };
  render() {
    return (
        <div className={classes.root}>
          <CssBaseline/>
          <AppBar
              position="fixed"
              className={clsx(classes.appBar, {
                [classes.appBarShift]: open,
              })}
          >
            <Toolbar style={{justifyContent: 'space-between'}}>
              <Typography variant="h6" noWrap>
                Adopt A Storm Drain Lafayette
              </Typography>
              <div>
                <IconButton
                    color="inherit"
                    aria-label="open drawer"
                    onClick={handleDrawerOpen}
                    edge="end"
                    className={clsx(open && classes.hide)}
                >
                  <MenuIcon/>
                </IconButton>
              </div>
            </Toolbar>
          </AppBar>
          <Drawer
              className={classes.drawer}
              variant="persistent"
              anchor="right"
              open={open}
              classes={{
                paper: classes.drawerPaper,
              }}
          >
            <div className={classes.drawerHeader}>
              <IconButton onClick={handleDrawerClose}>
                {theme.direction === 'rtl' ? <ChevronLeftIcon/> : <ChevronRightIcon/>}
              </IconButton>
            </div>
            <Divider/>

          </Drawer>
          <main
              className={clsx(classes.content, {
                [classes.contentShift]: open,
              })}
          >
            <div className={classes.drawerHeader}/>
            <Map
                google={this.props.google}
                zoom={14}
                styles={this.props.mapStyles}
                disableDefaultUI={true}
                onClick={this.saveCoords}
                onDragend={this.centerMoved}
                initialCenter={{
                  lat: this.state.loc_x,
                  lng: this.state.loc_y
                }}
            >
            </Map>
          </main>
        </div>
    )
  }
}

function mapStateToProps(state) {
  return {
    x: state.x,
    y: state.y
  }
}

export default connect(
    mapStateToProps,
    { saveMapCoords }
)(
    GoogleApiWrapper({
      apiKey: 'AIzaSyD4S8ESVxmEyKxSa-cfhgCS5yx_DfcVHnA'
    })(AaSD)
)
